import {Form,Main,Input,Button,Col,Label} from './style'
const DiscussForm=()=>{
    return( 
         <Main><Form><Col>
         <Label for="html">HTML</Label>
         <Input/>
         <Label for="html">HTML</Label>/>
        <Input/></Col><Col><Input/>
        <Input/></Col></Form>
        <Button></Button></Main>
        )
}
export default DiscussForm;
